class MessageParser {
  constructor(actionProvider) {
    this.actionProvider = actionProvider;
    this.hasTimePassed = false;
  }

  parse(message) {
    const lowerCaseMessage =
      message.toLowerCase();
    if (lowerCaseMessage.includes("oleosa")) {
      this.actionProvider.oilySkin();
    }
    if (lowerCaseMessage.includes("seca")) {
      this.actionProvider.drySkin();
    }
  }
}

export default MessageParser;
